import React from "react";
import './index.css'

export default function Card (props){
    return (
        <div className='card'>
            <h4>{props.nombre}</h4>
            <img className='img' src={props.img}/>
           <div className='informacion'>
               <div><h5>Temperamento:</h5> <span>{props.temp}</span> 
               </div>
               <div>Peso: {props.peso}</div>
           </div>
        </div>
    )
}
